package data;

public class UsersAndTheirRole {
String grantee;
String grantedRole;
String adminOption;
String defaultRole;
public UsersAndTheirRole() {
	// TODO Auto-generated constructor stub
}
public String getGrantee() {
	return grantee;
}
public void setGrantee(String grantee) {
	this.grantee = grantee;
}
public String getGrantedRole() {
	return grantedRole;
}
public void setGrantedRole(String grantedRole) {
	this.grantedRole = grantedRole;
}
public String getAdminOption() {
	return adminOption;
}
public void setAdminOption(String adminOption) {
	this.adminOption = adminOption;
}
public String getDefaultRole() {
	return defaultRole;
}
public void setDefaultRole(String defaultRole) {
	this.defaultRole = defaultRole;
}

}
